import React from "react";
import "./style.css";

const FirstBanner = () => {
  return (
    <div>
      {/* Container */}
      <span style={{ fontWeight: "600", marginBottom:"50px" }}>Hôm nay</span>
      <div className="grid-banner">
        {/* GridLayout */}
        <div className="grid-items">
          {/* box 1 */}
          <span className="grid-item-left">
            <i className="fa-sharp fa-solid fa-user"></i>
            <p>Nhân viên xuất sắc</p>
          </span>
        </div>
        <div className="grid-items">
          {/* box 2 */}
          <span className="grid-item-left">
            <i className="fa-sharp fa-solid fa-user"></i>
            <p>Khách hàng mới</p>
          </span>
        </div>
        <div className="grid-items">
          {/* box 3 */}
          <span className="grid-item-left">
            <i className="fa-sharp fa-solid fa-user"></i>
            <p>Số task mới</p>
          </span>
        </div>
        <div className="grid-items">
          {/* box 4 */}
          <span className="grid-item-left">
            <i className="fa-sharp fa-solid fa-user"></i>
            <p>Số task đã hoàn thành</p>
          </span>
        </div>
      </div>
    </div>
  );
};

export default FirstBanner;
